import React from "react";
import { connect } from "react-redux";

const mapStateToProps = (state) => {
    return {
        addProject: state.addProject
    }
};

const addCard = (props) => {
    return (
        <div>
            <div>AddProject</div>
            <div>
                {props.addProject.map(
                    i => <div key={i.name}>
                    {i.name} : {i.description} </div>
                )}
            </div>
        </div>
    )
} 

export default connect(mapStateToProps)(addCard);
